import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import App from './App';
import * as serviceWorker from './components/serviceWorker';

const state = {
    text: 'Tämä on teksti.'
}

function clickHandler(){
    state.text = 'Tämä on uusi teksti!'
    render()
}

function render(){
    ReactDOM.render(<App {...state} onClick={clickHandler}/>, document.getElementById('root'));
}
render();
serviceWorker.register();
